    {
      "calculate": "datum.doc_count",
      "as": "Count"
    }
  ],
  "mark": {
    "type": "arc",
    "innerRadius": 50,
    "tooltip": true
  },
  "encoding": {
    "theta": {
      "field": "Count",
      "type": "quantitative"
    },
    "color": {
      "field": "Error Category",
      "type": "nominal",
      "scale": {
        "scheme": "category10"
      },
      "legend": {
        "title": "Error Type"
      }
    },
    "tooltip": [
      {
        "field": "Error Category",
        "type": "nominal"
      },
      {
        "field": "Count",
        "type": "quantitative"
      }
    ]
  }
}"}}
